import React from "react";

export default class Login extends React.Component {
  state = {};
  render() {
    return (
      <div>
        <input
          name="username"
          onChange={(event) => {
            this.setState({ username: event.target.value });
          }}
        />
        <br/>
        <input
          name="password"
          onChange={(event) => {
            this.setState({ password: event.target.value });
          }}
        />
        <input
          name="role"
          onChange={(event) => {
            this.setState({ role: event.target.value });
          }}
        />
      </div>
    );
  }
}
